import React from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer';

const Container = styled.div`
  background-color: #eef2f4;
  display: flex;
  flex-direction: column;
  min-height: 100vh;
`;

const MainContent = styled.div`
  display: flex;
  width: 100%;
  flex-direction: column;
  align-items: center;
  justify-content: stretch;
  padding: 21px 0 179px;
`;

const Divider = styled.div<{ top?: boolean }>`
  align-self: stretch;
  min-height: 0px;
  margin-top: ${props => props.top ? '100px' : '10px'};
  width: 99.9%;
  border: 1px solid #d5d5d5;
`;

const BreadcrumbSort = styled.div`
  display: flex;
  width: 100%;
  max-width: 70%;
  gap: 2px;
  flex-wrap: wrap;
  justify-content: space-between;
  margin: 9px 0 0 0px;

  @media (max-width: 991px) {
    width: 70%;
    justify-content: center;
    gap: 2rem;
  }
`;

const Breadcrumb = styled.div`
  align-self: start;
  display: flex;
  gap: 12px;
  color: #000;
  font: 15px Open Sans, sans-serif;
`;

const BreadcrumbItem = styled.span<{ bold?: boolean }>`
  align-self: stretch;
  border-radius: 10px;
  background-color: #fff;
  padding: 4px 14px;
  font: ${props => props.bold ? '700' : '400'} 15px Open Sans, sans-serif;
`;

const ShippingContainer = styled.div`
  align-self: center;
  display: flex;
  margin-top: 38px;
  width: 100%;
  max-width: 70%;
  flex-direction: column;
  font-family: Open Sans, sans-serif;
  color: #000;
  font-weight: 700;

  @media (max-width: 991px) {
    max-width: 100%;
    padding: 0 20px;
  }
`;

const ShippingTitle = styled.h1`
  font-size: 25px;
  align-self: center;
  margin-bottom: 30px;
`;

const ShippingMethodsContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 20px;
  width: 100%;
  max-width: 600px;
  margin: 0 auto;
`;

const ShippingMethod = styled.div`
  border-radius: 10px;
  background-color: #fff;
  padding: 20px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  cursor: pointer;
  transition: all 0.3s ease;

  &:hover {
    box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  }
`;

const MethodInfo = styled.div`
  display: flex;
  flex-direction: column;
  gap: 5px;
`;

const MethodName = styled.h3`
  font-size: 16px;
  margin: 0;
`;

const MethodDescription = styled.p`
  font-size: 14px;
  color: #666;
  font-weight: 400;
  margin: 0;
`;

const MethodPrice = styled.span`
  font-size: 18px;
  color: #0055b6;
`;

const ContinueButton = styled.button`
  border-radius: 30px;
  background-color: rgba(0, 85, 182, 1);
  margin-top: 32px;
  text-align: center;
  font-size: 15px;
  color: #fff;
  border: none;
  padding: 19px 150px;
  cursor: pointer;
  align-self: center;

  @media (max-width: 991px) {
    padding: 15px 50px;
  }
`;

const ShippingDetails: React.FC = () => {
  const navigate = useNavigate();

  const handleContinue = () => {
    navigate('/payment');
  };

  return (
    <Container>
      <MainContent>
        <Header />
        <Divider top />
        <BreadcrumbSort>
          <Breadcrumb>
            <BreadcrumbItem bold>yannstechub</BreadcrumbItem>
            <BreadcrumbItem bold>/ Shipping Details</BreadcrumbItem>
          </Breadcrumb>
        </BreadcrumbSort>
        <Divider />
        <ShippingContainer>
          <ShippingTitle>Select Shipping Method</ShippingTitle>
          <ShippingMethodsContainer>
            <ShippingMethod>
              <MethodInfo>
                <MethodName>Standard Shipping</MethodName>
                <MethodDescription>Delivery in 5-7 business days</MethodDescription>
              </MethodInfo>
              <MethodPrice>Free</MethodPrice>
            </ShippingMethod>
            <ShippingMethod>
              <MethodInfo>
                <MethodName>Express Shipping</MethodName>
                <MethodDescription>Delivery in 2-3 business days</MethodDescription>
              </MethodInfo>
              <MethodPrice>$15.00</MethodPrice>
            </ShippingMethod>
            <ShippingMethod>
              <MethodInfo>
                <MethodName>Next Day Delivery</MethodName>
                <MethodDescription>Delivery by tomorrow if ordered before 2 PM</MethodDescription>
              </MethodInfo>
              <MethodPrice>$25.00</MethodPrice>
            </ShippingMethod>
          </ShippingMethodsContainer>
          <ContinueButton onClick={handleContinue}>
            Continue to Payment
          </ContinueButton>
        </ShippingContainer>
      </MainContent>
      <Footer />
    </Container>
  );
};

export default ShippingDetails;
